import React from 'react';
import { Text, View, Image } from 'react-native';
import { SimpleLineIcons, MaterialIcons, MaterialCommunityIcons, FontAwesome } from "@expo/vector-icons";
import { SafeAreaView } from 'react-native-safe-area-context';
import { NavigationContainer } from "@react-navigation/native";
import { createDrawerNavigator, DrawerItemList } from "@react-navigation/drawer";

import User from "./assets/user.jpg";
import Home from "./screens/Home";
import Timer from "./screens/Timer";
import Categorias from "./screens/Inventario/Categorias";
import Productos from "./screens/Inventario/Productos";
import Inventario from "./screens/Inventario/Inventario";
import InventarioHabitacion from "./screens/Inventario/InventarioHabitacion"
import Backups from "./screens/Backups";
import RateApp from "./screens/RateApp"
import Settings from "./screens/Settings"

const Drawer = createDrawerNavigator();

const CustomDrawerContent = (props) => {
    return (
        <SafeAreaView>
            <View style={{ height: 200, width: '100%', justifyContent: 'center', alignItems: 'center', borderBottomColor: "#f4f4f4", borderBottomWidth: 1 }}>
                <Image source={User} style={{ height: 130, width: 130, borderRadius: 65 }} />
                <Text style={{ fontSize: 22, marginVertical: 6, fontWeight: "bold", color: "#111" }}>Juliana Martinez</Text>
                <Text style={{ fontSize: 16, color: "#111" }} >Administrador</Text>
            </View>
            <DrawerItemList {...props} />
        </SafeAreaView>
    );
};

const GroupedScreens = () => {
    <React.Fragment>
        <Drawer.Screen
                    name="Categorias"
                    component={Categorias}
                    options={{
                        drawerLabel: "Categorias",
                        title: "Categorias",
                        drawerIcon: ({ color, size }) => (
                            <MaterialIcons name="category" size={size} color={color} />
                        )
                    }}
                />
                <Drawer.Screen
                    name="Productos"
                    component={Productos}
                    options={{
                        drawerLabel: "Productos",
                        title: "Productos",
                        drawerIcon: ({ color, size }) => (
                            <MaterialIcons name="shopping-cart" size={size} color={color} />
                        )
                    }}
                />
                <Drawer.Screen
                    name="Inventarios"
                    component={Inventario}
                    options={{
                        drawerLabel: "Inventarios",
                        title: "Inventarios",
                        drawerIcon: ({ color, size }) => (
                            <MaterialIcons name="inventory" size={size} color={color} />
                        )
                    }}
                />
                <Drawer.Screen
                    name="Inventario Habitacion"
                    component={InventarioHabitacion}
                    options={{
                        drawerLabel: "Inventario Habitacion",
                        title: "Inventario Habitacion",
                        drawerIcon: ({ color, size }) => (
                            <MaterialIcons name="single-bed" size={size} color={color} />
                        )
                    }}
                />
    </React.Fragment>
}

export default function App() {
    return (
        <NavigationContainer>
            <Drawer.Navigator drawerContent={CustomDrawerContent} screenOptions={{ drawerStyle: { backgroundColor: "#fff", width: 250 }, headerStyle: { backgroundColor: "#f4511e", }, headerTintColor: "#fff", headerTitleStyle: { fontWeight: "bold" }, drawerActiveTintColor: "blue", drawerLabelStyle: { color: "#111" } }}>
                <Drawer.Screen
                    name="Home"
                    component={Home}
                    options={{
                        drawerLabel: "Home",
                        title: "Home",
                        drawerIcon: ({ color, size }) => (
                            <SimpleLineIcons name="home" size={size} color={color} />
                        )
                    }}
                />
                <Drawer.Screen
                    name="Timer"
                    component={Timer}
                    options={{
                        drawerLabel: "Timer",
                        title: "Timer",
                        drawerIcon: ({ color, size }) => (
                            <MaterialIcons name="timer" size={size} color={color} />
                        )
                    }}
                />
                <Drawer.Screen
                    name="Backups"
                    component={Backups}
                    options={{
                        drawerLabel: "Backups",
                        title: "Backups",
                        drawerIcon: ({ color, size }) => (
                            <MaterialIcons name="backup" size={size} color={color} />
                        )
                    }}
                />
                <Drawer.Screen
                    name="Settings"
                    component={Settings}
                    options={{
                        drawerLabel: "Settings",
                        title: "Settings",
                        drawerIcon: ({ color, size }) => (
                            <SimpleLineIcons name="settings" size={size} color={color} />
                        )
                    }}
                />
                <Drawer.Screen
                    name="Rate app"
                    component={RateApp}
                    options={{
                        drawerLabel: "Rate app",
                        title: "Rate app",
                        drawerIcon: ({ color, size }) => (
                            <MaterialIcons name="star-rate" size={size} color={color} />
                        )
                    }}
                />
            </Drawer.Navigator>
        </NavigationContainer>
    );
}
